import React from "react";
import PathfindingVisualizer from "./Components/PathfindingVisualizer";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="App-header">
        <code style="">Pathfinding Visualiser</code>
        <PathfindingVisualizer></PathfindingVisualizer>
      </div>
    </div>
  );
}
export default App;
